import './base.css';
import React, { useState, useEffect, useCallback } from 'react';
import { setState, setRotation } from './redux/appSlice';
import { useSelector, useDispatch } from 'react-redux';
import axios from 'axios';
import GoogleMapReact from 'google-map-react';
import { Loader } from "@googlemaps/js-api-loader";
import { Wrapper } from "@googlemaps/react-wrapper";

const apikey = "AIzaSyC9qsxaC4dHG0ibEr9NMKC9Ddro_jdnMk8";

function Gmap() {


    const [googleMapsApiLoaded, setGoogleMapsApiLoaded] = useState(false);

    const loader = new Loader({
        apiKey: "AIzaSyC9qsxaC4dHG0ibEr9NMKC9Ddro_jdnMk8",
        version: 'weekly',
        region: 'JP',
        language: 'ja',
        libraries: ['places']
    });

    const mapOptions = {
        center: {
            lat: 0,
            lng: 0
        },
        zoom: 4
    };
    loader
        .load()
        .then((google) => {
            new google.maps.Map(document.getElementById("map"), mapOptions);

            setGoogleMapsApiLoaded(true);
        })
        .catch(e => {
            // do something
        });

    return (

            <div id="map"></div>

    );
}
export default Gmap;
